import showcaselogo from '../assets/1.jpg'
const Home = () => {

    return ( 
        
        <div className="container-lg mt-3 bg-light">
            <div className="row justify-content-around align-items-center">
            <div className=" col-8 col-lg-6">
                    <img id="showcase-img" className="img=fluid d-none d-lg-block" src={showcaselogo} alt="The Image" />
                </div>
                <div className="col-8 col-lg-4 ">
                    <h1 className = 'text-center'>فروشنده شو</h1>
                    <p className='lead'>با فروشنده شو می توانید به سادگی محصولات خود را به اشتراک گذارید و به فروش برسانید ، برای قبت محصول کافی است روی دکمه زیر کلیک کنید</p>
                </div>

            </div>
        </div>
        

     );
}
 
export default Home;
